import React, { Component } from "react";

class ShowMyList extends Component {

    createlist(item){
      return <li key = {item.key} onclick={this.deleteItem}>{item.value}</li> 
    }

    deleteItem(e){
      this.showList.delete(item.key);
    }

    render() {     
        var myList = this.props.entries;
        var showList = myList.map(this.createlist);
        return (
            <ul>
                {showList}
            </ul>
        );
    }
};

export default ShowMyList;
